(12, 1, '2016-03-31 15:13:40', '2016-03-31 07:13:40', '<h1 class="tcolor"><strong><em><span class="wcolor">SSA</span> Consulting Group</em></strong></h1>\r\n<p class="col-sm-9 wcolor">SSA Consulting Group (SSA) is an umbrella corporation providing professional services, for nearly three decades, in the areas of training, management consulting, public accounting, estate planning.</p>\r\n<p class="col-sm-9 wcolor">SSA has been consistently ranked among the top 1,000 SMEs in Singapore (2011-2014). To date, we have consulted for more than 200 companies, business enterprises and non-profit organisations and trained more than 100,000 members of Singapore''s workforce.</p>', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2016-05-11 11:51:34', '2016-05-11 03:51:34', '', 0, 'http://ssagroup.dev/?page_id=12', 0, 'page', '', 0),
