(347, 1, '2016-05-11 12:51:58', '2016-05-11 04:51:58', '<p class="col-sm-10 wcolor">Over the years, SSA Consulting Group has trained more than 100,000 individuals at rank and file, supervisory and management levels across various industries in Singapore and in the South-East Asian region.</p>\r\n[button class="know-more" url="http://consulting.ssagroup.com" text="Know more"]', 'Training', '', 'inherit', 'closed', 'closed', '', '55-revision-v1', '', '', '2016-05-11 12:51:58', '2016-05-11 04:51:58', '', 55, 'http://ssagroup.dev/uncategorized/55-revision-v1/', 0, 'revision', '', 0),
(348, 1, '2016-05-11 12:56:24', '2016-05-11 04:56:24', '<p class="col-sm-offset-2 col-sm-10 wcolor text-right">Our certified consultants are passionate about resolving complexities faced by today''s multifaceted organisations and that is why our clients entrust us with their most pressing and challenging issues</p>\r\n[button class="know-more" url="http://consulting.ssagroup.com" text="Know more"]', 'Consulting', '', 'inherit', 'closed', 'closed', '', '57-revision-v1', '', '', '2016-05-11 12:56:24', '2016-05-11 04:56:24', '', 57, 'http://ssagroup.dev/uncategorized/57-revision-v1/', 0, 'revision', '', 0),
